import React, {Component} from 'react';

class SandBox extends Component {

	onClick() {
		console.log('Boom!');
	}

	render() {

	    const project = "San Box";

		return (
			<div>
				<h1 onClick={SandBox.onClick}>{project}</h1>
				<p>Paragraph</p>
			</div>
		)
	}

}

export default SandBox;
